function getDetoxPosts(){const o=document.querySelector("#destination");fetch("json/detox.json").then(function(n){return n.json()}).then(function(n){n.forEach(function(n,e){var t=n.title.rendered,n=(n.excerpt.rendered,n.id);o.innerHTML=o.innerHTML+`<li><a href="./post.html?id=${n}">${t}</a></li>`})})}window.onload=function(){var n=window.performance.timing.domContentLoadedEventEnd-window.performance.timing.navigationStart;console.log("Page load time is "+n);const e=document.querySelector("#speed");e.innerHTML=n+" ms",getDetoxPosts()};